import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { GridList, GridListTile, GridListTileBar, ListSubheader, IconButton, Icon } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'space-around',
        overflow: 'hidden',
        backgroundColor: theme.palette.background.paper,
    },
    gridList: {
        width: 600,
        height: 550,
    },
    icon: {
        color: 'rgba(255, 255, 255, 0.54)',
    },
}));

const friendList = [
    {
        img: 'https://www.cambridgesciencefestival.org/wp-content/uploads/2019/03/maxresdefault.jpg',
        title: 'Brody Banner',
    },
    {
        img: 'https://www.cambridgesciencefestival.org/wp-content/uploads/2019/03/maxresdefault.jpg',
        title: 'Terri Banner',
    },
    {
        img: 'https://www.cambridgesciencefestival.org/wp-content/uploads/2019/03/maxresdefault.jpg',
        title: 'Stan Banner',
    },
]

function Friends() {

    const classes = useStyles();

    return (
        <div className="col-12">
            <div className={classes.root}>
                <GridList cellHeight={180} className={classes.gridList}>
                    <GridListTile key="Subheader" cols={2} style={{height: 'auto'}}>
                        <ListSubheader component="div">Friends</ListSubheader>
                    </GridListTile>
                    {friendList.map((friend, index) => {
                        return (
                            <GridListTile key={index} >
                                <img src={friend.img} />
                                <GridListTileBar 
                                    title={friend.title}
                                    actionIcon={
                                        <IconButton className={classes.icon}>
                                            <Icon>exit_to_app</Icon>
                                        </IconButton>
                                    }
                                />
                            </GridListTile>
                        )
                    })}
                </GridList>
            </div>
        </div>
    );
}

export default Friends;
